export class CoeurserviceService {

  private apiUrl = 'https://localhost:7129/api/ComplicationCoeurs';

  constructor(private http: HttpClient) { }
  addcompcoeur(ComplicationCoeur: ComplicationCoeur): Observable<HttpResponse<any>> {
    console.log('Creating it with data:', ComplicationCoeur);

    return this.http.post<any>(`${this.apiUrl}/addcompcoeur`, ComplicationCoeur, { observe: 'response' });
  }
  updateComplicationCoeur(id: number, complicationCoeur: ComplicationCoeur): Observable<HttpResponse<any>> {
    return this.http.put<any>(`${this.apiUrl}/update/${id}`, complicationCoeur, { observe: 'response' });
  }
  getComplicationCoeur(id: number): Observable<ComplicationCoeur> {
    return this.http.get<ComplicationCoeur>(`${this.apiUrl}/${id}`);
  }


}
